import React, { useState } from 'react';

const Report = () => {
  const formStyle = {
    background: 'linear-gradient(to bottom, #DAF5B6, #ffffff)',
    padding: '50px 20px',
    borderRadius: '10px',
    margin: '20px auto',
    maxWidth: '600px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  };

  const headingStyle = {
    color: '#388e3c',
    fontSize: '28px',
    textAlign: 'center',
    marginBottom: '20px',
  };

  const labelStyle = {
    color: '#555',
    fontSize: '16px',
    marginBottom: '10px',
    display: 'block',
  };

  const inputStyle = {
    width: '100%',
    padding: '10px',
    fontSize: '16px',
    marginBottom: '20px',
    borderRadius: '5px',
    border: '1px solid #ddd',
  };

  const buttonStyle = {
    backgroundColor: '#388e3c',
    color: '#fff',
    fontSize: '16px',
    padding: '10px 20px',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    width: '100%',
  };

  const [formData, setFormData] = useState({
    title: '',
    category: '',
    date: '',
    location: '',
    content: '',
    image: null,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleFileChange = (e) => {
    setFormData((prevData) => ({
      ...prevData,
      image: e.target.files[0],
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form Data:', formData);
    alert('Your report has been submitted!');
  };

  return (
    <div style={formStyle}>
      <h1 style={headingStyle}>Submit a Report</h1>
      <form onSubmit={handleSubmit}>
        <label style={labelStyle} htmlFor="title">Title</label>
        <input
          type="text"
          id="title"
          name="title"
          style={inputStyle}
          value={formData.title}
          onChange={handleChange}
          required
        />

        <label style={labelStyle} htmlFor="category">Category</label>
        <select
          id="category"
          name="category"
          style={inputStyle}
          value={formData.category}
          onChange={handleChange}
          required
        >
          <option value="">Select a category</option>
          <option value="air pollution">Air Pollution</option>
          <option value="waste management">Waste Management</option>
          <option value="water pollution">Water Pollution</option>
        </select>

        <label style={labelStyle} htmlFor="date">Date</label>
        <input
          type="date"
          id="date"
          name="date"
          style={inputStyle}
          value={formData.date}
          onChange={handleChange}
          required
        />

        <label style={labelStyle} htmlFor="location">Location</label>
        <input
          type="text"
          id="location"
          name="location"
          style={inputStyle}
          value={formData.location}
          onChange={handleChange}
          required
        />

        <label style={labelStyle} htmlFor="content">Report Content</label>
        <textarea
          id="content"
          name="content"
          style={{ ...inputStyle, height: '100px' }}
          value={formData.content}
          onChange={handleChange}
          required
        ></textarea>

        <label style={labelStyle} htmlFor="image">Upload Image</label>
        <input
          type="file"
          id="image"
          name="image"
          style={inputStyle}
          accept="image/*"
          onChange={handleFileChange}
        />

        <button type="submit" style={buttonStyle}>Submit</button>
      </form>
    </div>
  );
};

export default Report;
